import React from "react";


function App() {
    let likes = 0;
    return (
        <div className="App">
            <h1>{likes}</h1>
            <button onClick={() => likes += 1}>More</button>
            <button onClick={() => likes -= 1}>Lower</button>
        </div>
    );
}

export default App;
